  <style>
    @import url(https://fonts.googleapis.com/css2?family=Playfair+Display:wght@400;500;600;700&family=Inter:wght@300;400;500;600;700&display=swap);
  </style>
  <style>
    /* Import Google Fonts */

    /* Global Styles */
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
      background: #fafafa;
      color: #1a1a1a;
      line-height: 1.6;
    }

    .App {
      min-height: 100vh;
    }

    /* Typography */
    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      font-family: 'Playfair Display', serif;
      font-weight: 600;
      line-height: 1.2;
      color: #1a1a1a;
    }

    h1 {
      font-size: clamp(2.5rem, 5vw, 4rem);
      font-weight: 700;
    }

    h2 {
      font-size: clamp(2rem, 4vw, 3rem);
    }

    h3 {
      font-size: clamp(1.5rem, 3vw, 2rem);
    }

    /* Luxury Color Palette */
    :root {
      --primary: #d4af37;
      --primary-dark: #b8941f;
      --secondary: #2c2c2c;
      --accent: #f5f5f0;
      --text: #1a1a1a;
      --text-light: #666;
      --border: #e5e5e5;
      --shadow: 0 4px 20px rgba(0, 0, 0, 0.08);
      --gradient-gold: linear-gradient(135deg, #d4af37 0%, #f4e4a6 50%, #d4af37 100%);
      --gradient-dark: linear-gradient(135deg, #2c2c2c 0%, #404040 100%);
    }

    /* Buttons */
    .btn {
      display: inline-flex;
      align-items: center;
      justify-content: center;
      padding: 12px 24px;
      border: none;
      border-radius: 8px;
      font-family: 'Inter', sans-serif;
      font-weight: 500;
      text-decoration: none;
      cursor: pointer;
      transition: all 0.3s ease;
      position: relative;
      overflow: hidden;
    }

    .btn-primary {
      background: var(--gradient-gold);
      color: var(--secondary);
      box-shadow: var(--shadow);
    }

    .btn-primary:hover {
      transform: translateY(-2px);
      box-shadow: 0 8px 30px rgba(212, 175, 55, 0.3);
    }

    .btn-secondary {
      background: transparent;
      color: var(--text);
      border: 2px solid var(--border);
    }

    .btn-secondary:hover {
      background: var(--secondary);
      color: white;
      border-color: var(--secondary);
    }

    .btn-whatsapp {
      background: linear-gradient(135deg, #25d366 0%, #128c7e 100%);
      color: white;
      font-weight: 600;
      padding: 16px 32px;
      font-size: 1.1rem;
    }

    .btn-whatsapp:hover {
      transform: translateY(-2px);
      box-shadow: 0 8px 30px rgba(37, 211, 102, 0.4);
    }

    /* Cards */
    .card {
      background: white;
      border-radius: 16px;
      overflow: hidden;
      box-shadow: var(--shadow);
      transition: all 0.3s ease;
      border: 1px solid var(--border);
    }

    .card:hover {
      transform: translateY(-4px);
      box-shadow: 0 12px 40px rgba(0, 0, 0, 0.12);
    }

    .card-image {
      width: 100%;
      height: 250px;
      object-fit: cover;
      transition: transform 0.3s ease;
    }

    .card:hover .card-image {
      transform: scale(1.05);
    }

    .card-content {
      padding: 24px;
    }

    /* Form Elements */
    .form-group {
      margin-bottom: 24px;
    }

    .form-label {
      display: block;
      margin-bottom: 8px;
      font-weight: 500;
      color: var(--text);
    }

    .form-input {
      width: 100%;
      padding: 12px 16px;
      border: 2px solid var(--border);
      border-radius: 8px;
      font-family: 'Inter', sans-serif;
      font-size: 16px;
      transition: border-color 0.3s ease;
    }

    .form-input:focus {
      outline: none;
      border-color: var(--primary);
      box-shadow: 0 0 0 3px rgba(212, 175, 55, 0.1);
    }

    .form-select {
      width: 100%;
      padding: 12px 16px;
      border: 2px solid var(--border);
      border-radius: 8px;
      font-family: 'Inter', sans-serif;
      font-size: 16px;
      background: white;
      cursor: pointer;
    }

    /* Grid Systems */
    .grid {
      display: grid;
      gap: 24px;
    }

    .grid-1 {
      grid-template-columns: 1fr;
    }

    .grid-2 {
      grid-template-columns: repeat(2, 1fr);
    }

    .grid-3 {
      grid-template-columns: repeat(3, 1fr);
    }

    .grid-4 {
      grid-template-columns: repeat(4, 1fr);
    }

    @media (max-width: 768px) {

      .grid-2,
      .grid-3,
      .grid-4 {
        grid-template-columns: 1fr;
      }
    }

    @media (min-width: 769px) and (max-width: 1024px) {

      .grid-3,
      .grid-4 {
        grid-template-columns: repeat(2, 1fr);
      }
    }

    /* Utility Classes */
    .container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 0 20px;
    }

    .text-center {
      text-align: center;
    }

    .text-left {
      text-align: left;
    }

    .text-right {
      text-align: right;
    }

    .mb-0 {
      margin-bottom: 0;
    }

    .mb-1 {
      margin-bottom: 8px;
    }

    .mb-2 {
      margin-bottom: 16px;
    }

    .mb-3 {
      margin-bottom: 24px;
    }

    .mb-4 {
      margin-bottom: 32px;
    }

    .mb-5 {
      margin-bottom: 48px;
    }

    .mt-0 {
      margin-top: 0;
    }

    .mt-1 {
      margin-top: 8px;
    }

    .mt-2 {
      margin-top: 16px;
    }

    .mt-3 {
      margin-top: 24px;
    }

    .mt-4 {
      margin-top: 32px;
    }

    .mt-5 {
      margin-top: 48px;
    }

    .py-5 {
      padding: 48px 0;
    }

    .py-10 {
      padding: 80px 0;
    }

    .py-20 {
      padding: 160px 0;
    }

    /* Loading States */
    .loading {
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 48px;
    }

    .spinner {
      width: 32px;
      height: 32px;
      border: 3px solid var(--border);
      border-top: 3px solid var(--primary);
      border-radius: 50%;
      animation: spin 1s linear infinite;
    }

    @keyframes spin {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    /* Animations */
    .fade-in {
      animation: fadeIn 0.6s ease-in;
    }

    @keyframes fadeIn {
      from {
        opacity: 0;
        transform: translateY(20px);
      }

      to {
        opacity: 1;
        transform: translateY(0);
      }
    }

    .slide-up {
      animation: slideUp 0.6s ease-out;
    }

    @keyframes slideUp {
      from {
        opacity: 0;
        transform: translateY(40px);
      }

      to {
        opacity: 1;
        transform: translateY(0);
      }
    }

    /* Badge */
    .badge {
      display: inline-block;
      padding: 4px 12px;
      font-size: 0.85rem;
      font-weight: 600;
      border-radius: 20px;
      text-transform: uppercase;
      letter-spacing: 0.5px;
    }

    .badge-success {
      background: #d4edda;
      color: #155724;
    }

    .badge-warning {
      background: #fff3cd;
      color: #856404;
    }

    .badge-danger {
      background: #f8d7da;
      color: #721c24;
    }

    /* Navbar specific */
    .navbar-glass {
      background: rgba(255, 255, 255, 0.95);
      backdrop-filter: blur(20px);
      border-bottom: 1px solid rgba(229, 229, 229, 0.3);
    }

    /* Cart Badge */
    .cart-badge {
      position: absolute;
      top: -8px;
      right: -8px;
      background: #ff4444;
      color: white;
      border-radius: 50%;
      width: 20px;
      height: 20px;
      font-size: 0.75rem;
      display: flex;
      align-items: center;
      justify-content: center;
      font-weight: 600;
    }

    /* Product Price */
    .price {
      font-family: 'Inter', sans-serif;
      font-weight: 600;
      color: var(--primary);
    }

    .price-large {
      font-size: 1.5rem;
    }

    /* Alert Messages */
    .alert {
      padding: 16px;
      border-radius: 8px;
      margin-bottom: 24px;
      border-left: 4px solid;
    }

    .alert-success {
      background: #d4edda;
      color: #155724;
      border-left-color: #28a745;
    }

    .alert-error {
      background: #f8d7da;
      color: #721c24;
      border-left-color: #dc3545;
    }

    .alert-warning {
      background: #fff3cd;
      color: #856404;
      border-left-color: #ffc107;
    }

    /* Responsive Design */
    @media (max-width: 640px) {
      .container {
        padding: 0 16px;
      }

      .btn {
        width: 100%;
        justify-content: center;
      }

      .card-content {
        padding: 16px;
      }
    }

    /* Custom Scrollbar */
    ::-webkit-scrollbar {
      width: 8px;
    }

    ::-webkit-scrollbar-track {
      background: #f1f1f1;
    }

    ::-webkit-scrollbar-thumb {
      background: var(--primary);
      border-radius: 4px;
    }

    ::-webkit-scrollbar-thumb:hover {
      background: var(--primary-dark);
    }

    /*# sourceMappingURL=data:application/json;base64, */
  </style>
